Well today is the first day of school & i really dont want to go i know all im gonna be thinking about is eddie, i really hope i have some classes with kids i know .. i know i will atleast have a class with sarah aus & mandy cause we all have child development together godd.. i hope today doesnt suck cause then i'll have to go to work afterwards & that'll be sucky!


fill you in more later.. 

eddie&hearts;

I was thinking about what you said last night, that what we had won`t happen again.. & i think you`re wrong. Sure what we had we`ve lost, but things don`t stay lost forever, eventually they are found. History also repeats itself & i don`t think we would have been given something so great, for it to just get lost & never be found. I realize it won`t be found anytime soon, but someday perhaps 20 years from now i think what was lost will be found.

&hearts;
Chelle
